        fetch('https://6487473fbeba6297279060f8.mockapi.io/items/' + id )
    }, []);

    return(
        <div className="container">
            <img src="" alt="" />
            <h2>{id}</h2>
            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Ratione, iusto.</p>
            <h4>250 p</h4>
        </div>
    )
}

